			shellScript = "# This script will only run in an env where Imagemagik has been installed. Typically, this is only on the build boxes adn developers don't need to run this script.\n\n#commit=`git rev-parse --short HEAD`\n#branch=`git rev-parse --abbrev-ref HEAD`\n#version=`/usr/libexec/PlistBuddy -c \"Print CFBundleVersion\" \"${INFOPLIST_FILE}\"`\nversion=`/usr/libexec/PlistBuddy -c \"Print CFBundleVersion\" \"${CONFIGURATION_BUILD_DIR}/${UNLOCALIZED_RESOURCES_FOLDER_PATH}/Info.plist\"`\n\nfunction processIcon()\n{\n    \n    export PATH=$PATH:/usr/local/bin\n    \n    if (type \"convert\" >/dev/null) ; then\n        base_file=$1\n        base_path=`find ${SRCROOT}/${PROJECT_NAME}/Images.xcassets/AppIcon.appiconset -name $base_file`\n    \n        if [[ ! -f ${base_path} || -z ${base_path} ]]; then\n            return;\n        fi\n    \n        # target_file=`echo $base_file | sed \"s/_base//\"`\n        target_file=$base_file\n        target_path=\"${CONFIGURATION_BUILD_DIR}/${UNLOCALIZED_RESOURCES_FOLDER_PATH}/${target_file}\"\n    \n        width=`identify -format %w ${base_path}`\n        height=`identify -format %h ${base_path}`\n        height=`expr $height \\/ 5`\n    \n        convert -background '#ffff' -fill black -gravity south -size ${width}x${height}\\\n        caption:\"${version}\"\\\n        ${base_path} +swap -gravity south -composite ${target_path}\n    fi\n}\n\n\nif [ $CONFIGURATION != \"Production\" ]; then\n    processIcon \"AppIcon60x60@2x.png\"\n    #processIcon \"AppIcon29x29@2x.png\"\n    #processIcon \"AppIcon40x40@2x.png\"\n    processIcon \"AppIcon76x76@2x~ipad.png\"\n    processIcon \"AppIcon76x76~ipad.png\"\n    #processIcon \"AppIcon40x40@2x~ipad.png\"\n    #processIcon \"AppIcon40x40~ipad.png\"\n    #processIcon \"AppIcon29x29@2x~ipad.png\"\n    #processIcon \"AppIcon29x29~ipad.png\"\nfi";
